import { jsx } from "@emotion/core";
import { style, barNum } from "./WaveStyle";
export function WaveLoading() {
    const list = [];
    for (let i = 0; i < barNum; i++) {
        list.push(jsx("span", { key: i, css: [style.item, style[`bar-${i}`]] }));
    }
    return (jsx("div", { css: style.container, className: "cl-WaveLoading" }, list));
}
